import React, { useState, useEffect } from 'react';
import { useNavigate, Link } from 'react-router-dom';
import '../CSS/Dashboard.css';

const Dashboard = () => {
  const [userData, setUserData] = useState(null);
  const [isLoading, setIsLoading] = useState(true);
  const navigate = useNavigate();

  useEffect(() => {
    // Check authentication status
    const isAuthenticated = localStorage.getItem('isAuthenticated');
    if (!isAuthenticated) {
      navigate('/login');
      return;
    }

    // Simulate fetching user data
    const fetchUserData = async () => {
      try {
        // Simulate API call
        await new Promise(resolve => setTimeout(resolve, 800));
        
        // Mock user data - replace with real API call
        const mockUserData = {
          name: 'John Doe',
          email: 'john@example.com',
          joinDate: 'January 15, 2023',
          lastLogin: new Date().toLocaleString(),
          stats: {
            projects: 5,
            tasksCompleted: 42,
            productivity: 87
          }
        };
        
        setUserData(mockUserData);
      } catch (error) {
        console.error('Failed to fetch user data:', error);
      } finally {
        setIsLoading(false);
      }
    };

    fetchUserData();
  }, [navigate]);

  const handleLogout = () => {
    localStorage.removeItem('isAuthenticated');
    navigate('/login');
  };

  if (isLoading) {
    return (
      <div className="dashboard-loading">
        <div className="spinner"></div>
        <p>Loading dashboard...</p>
      </div>
    );
  }

  return (
    <div className="dashboard-container">
      <header className="dashboard-header">
        <div className="header-content">
          <h1>Welcome back, {userData?.name}</h1>
          <button onClick={handleLogout} className="logout-btn">
            Logout
          </button>
        </div>
      </header>

      <div className="dashboard-content">
        <aside className="sidebar">
          <nav>
            <ul>
              <li className="active">
                <span>🏠</span> Dashboard
              </li>
              <li>
                <span>📊</span> Analytics
              </li>
              <li>
                <span>📝</span> Projects
              </li>
              <li>
                <span>✉️</span> Messages
              </li>
              <li>
                <span>⚙️</span> Settings
              </li>
              <li>
                <span>👤</span> 
                <Link to="/account">Account</Link>
              </li>
            </ul>
          </nav>
        </aside>

        <main className="main-content">
          <div className="stats-grid">
            <div className="stat-card">
              <h3>Projects</h3>
              <p className="stat-value">{userData?.stats.projects}</p>
              <p className="stat-description">Active projects</p>
            </div>
            
            <div className="stat-card">
              <h3>Tasks Completed</h3>
              <p className="stat-value">{userData?.stats.tasksCompleted}</p>
              <p className="stat-description">This month</p>
            </div>
            
            <div className="stat-card">
              <h3>Productivity</h3>
              <p className="stat-value">{userData?.stats.productivity}%</p>
              <p className="stat-description">Average score</p>
            </div>
          </div>

          <div className="recent-activity">
            <h2>Recent Activity</h2>
            <div className="activity-list">
              <div className="activity-item">
                <div className="activity-icon">✅</div>
                <div className="activity-details">
                  <p>Completed task "Design dashboard UI"</p>
                  <small>2 hours ago</small>
                </div>
              </div>
              <div className="activity-item">
                <div className="activity-icon">➕</div>
                <div className="activity-details">
                  <p>Added new project "Marketing Campaign"</p>
                  <small>1 day ago</small>
                </div>
              </div>
              <div className="activity-item">
                <div className="activity-icon">👥</div>
                <div className="activity-details">
                  <p>Team meeting with design department</p>
                  <small>2 days ago</small>
                </div>
              </div>
            </div>
          </div>
        </main>
      </div>

      <footer className="dashboard-footer">
        <p>Last login: {userData?.lastLogin}</p>
        <p>© 2023 Your Company. All rights reserved.</p>
      </footer>
    </div>
  );
};

export default Dashboard;
